import React from "react";
import "./style.css";
import "bootstrap/dist/css/bootstrap.min.css";


function Footer() {
  return (
    <footer className="footer">
      <span>Events Planner UNH coding bootcamp 2019</span>
    </footer>
  );
}

export default Footer;
